import React from 'react';
import DashboardOutlinedIcon from '@material-ui/icons/DashboardOutlined';
import './Meter2.css'
const HeaderTop = () => {
    return (
        <div>
            <div>
                <h2>Dashboard</h2>
                <DashboardOutlinedIcon/>
                <ul className="listStyle">
                    <li >Locations /</li>
                    <li>Solarpan01</li>
                </ul>
            </div>
        </div>
    );
};

export default HeaderTop;
